import { usePathname } from 'next/navigation';

import { Bell, Briefcase, Home, Settings, User } from 'lucide-react';

export const NavItems = () => {
  const pathname = usePathname();

  function isNavItemActive(pathname: string, nav: string) {
    return pathname.includes(nav);
  }

  return [
    {
      name: 'Home',
      href: '/',
      icon: <Home size={20} />,
      active: pathname === '/',
      position: 'top',
    },
    {
      name: 'Discover',
      href: '/discover',
      icon: <User size={20} />,
      active: isNavItemActive(pathname, '/discover'),
      position: 'top',
    },
    {
      name: 'Collections',
      href: '/collections',
      icon: <Bell size={20} />,
      active: isNavItemActive(pathname, '/collections'),
      position: 'top',
    },
    
    {
      name: 'Settings',
      href: '/settings',
      icon: <Settings size={20} />,
      active: isNavItemActive(pathname, '/settings'),
      position: 'bottom',
    },
  ];
};

